/**
 * Transport request status
 *   * `succeeded`
 *   * `warning`
 *   * `error`
 *   * `fatal`
 *   * `running`
 *   * `repeat`
 *   * `initial`
 *   * `deleted`
 *   * `unknown`
 *
 */
export type TRStatus = 'succeeded' | 'warning' | 'error' | 'fatal' | 'running' | 'repeat' | 'initial' | 'deleted' | 'unknown';
